import { Box } from '@mui/material';
import './App.css';
import { Route, Routes } from 'react-router-dom';

function App() {
  return (
    <div className="App">
<Box>
  <Routes>
    <Route path="/" element={<Home/>}/>
    <Route path="/exercise/:id" element={<ExerciseDetails/>}/>

  </Routes>
</Box>
    </div>
  );
}

export default App;
